function activeAlarms  = fcn(alarmsBus, time)
	%#codegen
    coder.varsize('alarmDiagnostics') 
    coder.extrinsic('num2str')
	%% declare maximum size of alarms list 
	% matlab function in Simulink blocks must have all variables bounded, so
	% the alarms list is created as a 300 row x 50 column character array
	alarmsListArray = repmat(char(0), 300, 50);
	alarmNames = fieldnames(alarmsBus); % get the element names of the input bus
	% init index vars
	nextIndex = 1;
	endingIndex = 1;
    alarmDiagnostic = '';
    persistent alarmsBusLast
    if isempty(alarmsBusLast)
     alarmsBusLast = alarmsBus;
    end

	%% loop over input bus alarm names, navigate down the bus if sub buses exist
	for i=1:length(alarmNames)
		% check if element is another structure (bus)
		if(isstruct(alarmsBus.(alarmNames{i})))
			% navigate the bus and build up the alarmsListArray for any alarms
			% that are true
			[alarmsListArray, nextIndex, alarmDiagnostic] = navigateBus(alarmsBus.(alarmNames{i}), alarmsListArray, nextIndex, alarmDiagnostic, alarmsBusLast.(alarmNames{i}));
		else
			% if the element is just a signal, act on it directly
			if(alarmsBus.(alarmNames{i}))
                if(not(alarmsBusLast.(alarmNames{i})))%If this alarm wasn't active last time add it to the display string
                    alarmDiagnostic = [alarmDiagnostic ' ' alarmNames{i}];   
                    %alarmDiagnostic = "true";
                end
				alarmsListArray(nextIndex,1:length(alarmNames{i})+1) = [alarmNames{i}, ' '];
				nextIndex = nextIndex + 1;
			end
		end
	end
	%% go through the final alarmsList and find out where the last entry is
	for j=1:length(alarmsListArray)
		if(isempty(deblank(alarmsListArray(j,:))))
			% when the chars are empty, we will only use up to the previous index
			endingIndex = j-1;
			break;
		end
	end
	% only grab the entries that were not empty
	activeAlarmsList = alarmsListArray(1:endingIndex,:);
	% only reshape if there is more than one alarm
	if(size(activeAlarmsList, 1) > 1)
		% the output string can only be a 1 by X string vector, so the
		% character array must have the rows transformed to columns and
		% appended together correctly
		% first swap rows and columns
		rowVectorTranspose = transpose(activeAlarmsList); 
		% then convert to 1 row by X columns
		rowVectorAlarmsList = reshape(rowVectorTranspose, 1, []); 
		% the result will still have many blank chars because of the 50 char
		% padding in the master alarms character array, strip these out 
		trailingEmptyRemoved = strrep(string(deblank(rowVectorAlarmsList)), char(0), '');
		% and finally, replace internal spaces with commas
		activeAlarms = strrep(trailingEmptyRemoved, ' ', ', ');
		if(size(activeAlarmsList, 1) == 1)
			% Even though this disp command can never be reached, it has to
			% remain, otherwise matlab cannot figure out how to bound the size of
			% the strrep functions above and will throw an error. I could never
			% figure out any other way to force it to properly assess the bounds
			% without the use of the disp command (which was accidentally working
			% during initial development and debug). 
			disp(activeAlarms);
		end
	elseif(size(activeAlarmsList, 1) == 1)
		% if there is only one active, just convert it to a string and trim 
		% the white space
		activeAlarms = string(deblank(activeAlarmsList));
	else
		activeAlarms = "No active alarms.";
    end
    if(not(isempty(alarmDiagnostic)))
     disp([alarmDiagnostic ' Time=' num2str(time) '(sec)']);
    end
    alarmsBusLast = alarmsBus;
end

%% internal function to recursively navigate arbitrary level of buses
function [alarmsListArray, nextIndex, alarmDiagnostic] = navigateBus(bus, varargin)
	% internal functions seem to require the use of varargin
	alarmsListArray = varargin{1}; % keep track of master array
	index = varargin{2}; % keep track of index
	alarmDiagnostic = varargin{3};
    busLast = varargin{4};
	% get the field names of the passed in bus and recurse as necessary
	elementNames = fieldnames(bus);
	for i=1:length(elementNames)
		if(isstruct(bus.(elementNames{i})))
			[alarmsListArray, index, alarmDiagnostic] = navigateBus(bus.(elementNames{i}), alarmsListArray, index,alarmDiagnostic, busLast.(elementNames{i}) );
		else
			if(bus.(elementNames{i}))
				alarmsListArray(index,1:length(elementNames{i})+1) = [elementNames{i}, ' '];
                if(not(busLast.(elementNames{i})))
                    alarmDiagnostic = [alarmDiagnostic ' ' elementNames{i}];   
                end
				index = index + 1;
			end
		end
	end
	% return the incremented index
	nextIndex = index;
end
